import React, { useEffect, useState } from 'react';
import { useQuery } from 'react-apollo-hooks';
import { fbQuery } from '../queries/queries';
import { Detail, Item, MasterDetail } from './MasterDetail';
export const GitHubList: React.FC = () => {

  interface searchArray{
    createdAt:string,
    name:string,
    url:string

  }
interface node{
  node:searchArray
}
  const {data,loading,error}=useQuery(fbQuery)
  const [fbList,setfbList]=useState<node[]>([]);
  useEffect(()=>{
data && setfbList(data.search.edges)
data&& console.log(data.search.edges[0])
  },[data])
if(fbList.length)
console.log([...fbList.map(child=><Item payload={{content:`URL:${child.node.url} Created At:${child.node.createdAt}`}}>{child.node.name}</Item>),<Detail>{(payload) => payload.content}</Detail>].map(child=>child))
  return <MasterDetail>
    {[...fbList.map(child=><Item payload={{content:`URL:${child.url} Created At:${child.createdAt}`}}>{child.name}</Item>),<Detail>{(payload) => payload.content}</Detail>].map(child=>child)}
  </MasterDetail>

  return <div>Loading....</div>
};
